local hs = 4
--Studs per pixel horizontally
local vs = hs/15
--Height multiplier. The maximum height is this multiplied by 255. (hs/15 is what's currently hard-coded in the preview).
local total = (#hmap-1) * (#hmap[2]-1)
local done = 0
local lt = 0
function throttle(itime)
if (tick() - lt > itime) then
wait()
print("Finished " .. done .. " of " .. total .. " terrain cells")
lt = tick()
end
end
local t = workspace.Terrain
t:Clear()
local xl = #hmap
for x = 2,xl do
local r = hmap[x]
local yl = #r
for y = 2,yl do
done = done + 1
local h = r[y]+20
local rr = r[y]
if (rr < 1) then
t:FillBlock(CFrame.new(math.floor((x-xl/2))*hs,vs*h/2,math.floor((y-yl/2))*hs), Vector3.new(hs+4,vs*h,hs+4), Enum.Material.Water)
elseif (rr < 20) then
t:FillBlock(CFrame.new(math.floor((x-xl/2))*hs,vs*h/2,math.floor((y-yl/2))*hs), Vector3.new(hs+4,vs*h,hs+4), Enum.Material.Sand)
elseif (rr < 150) then
t:FillBlock(CFrame.new(math.floor((x-xl/2))*hs,vs*h/2,math.floor((y-yl/2))*hs), Vector3.new(hs+4,vs*h,hs+4), Enum.Material.Grass)
elseif (rr < 200) then
t:FillBlock(CFrame.new(math.floor((x-xl/2))*hs,vs*h/2,math.floor((y-yl/2))*hs), Vector3.new(hs+4,vs*h,hs+4), Enum.Material.Rock)
else
t:FillBlock(CFrame.new(math.floor((x-xl/2))*hs,vs*h/2,math.floor((y-yl/2))*hs), Vector3.new(hs+4,vs*h,hs+4), Enum.Material.Slate)
end
throttle(0.1)
end
end
print("Done!")
